INSERT INTO `birthday_login_bonus_drama_script` VALUES (/*command_id*/1044501040, /*drama_id*/1044501, /*command_type*/11, /*param_01*/104411, /*param_02*/"うむ、わらわの誕生日を\n祝おうという心意気、感心じゃな。\n我が眷属よ、褒めて遣わすぞ。", /*param_03*/5, /*param_04*/1, /*param_05*/1, /*param_06*/0, /*param_07*/0, /*param_08*/"");
