INSERT INTO `birthday_login_bonus_drama_script` VALUES (/*command_id*/1044501043, /*drama_id*/1044501, /*command_type*/11, /*param_01*/104411, /*param_02*/"忠節を尽くす眷属には、主として\nその労に報いてやらねばな。\nどれ、わらわ手ずから\nお主にケーキを切り分けてやろう。", /*param_03*/5, /*param_04*/1, /*param_05*/1, /*param_06*/0, /*param_07*/0, /*param_08*/"");
