INSERT INTO `birthday_login_bonus_drama_script` VALUES (/*command_id*/1044501046, /*drama_id*/1044501, /*command_type*/11, /*param_01*/104411, /*param_02*/"食べ盛りじゃろうから、\n大きめカットにしてやったぞ。\nそうじゃ。お主よ、もっと近う寄れ。\nほれ、あーん……ふふ、美味であろう♪", /*param_03*/6, /*param_04*/1, /*param_05*/1, /*param_06*/0, /*param_07*/0, /*param_08*/"");
