INSERT INTO `birthday_login_bonus_drama_script` VALUES (/*command_id*/1044501049, /*drama_id*/1044501, /*command_type*/11, /*param_01*/104411, /*param_02*/"よく食べ、よく働き、そして\nこれからもわらわの眷属として\n大いに励むがよい。\nお主の働きに期待しておるぞ？", /*param_03*/4, /*param_04*/1, /*param_05*/1, /*param_06*/0, /*param_07*/0, /*param_08*/"");
